import React from 'react';
import {SearchOutlined} from '@ant-design/icons';

const Search = () => {
    return (
        <div>
            <form id="hashtag-form" action="/hashtag">
                <input type="text" name="hashtag" placeholder={<SearchOutlined /> + '검색'} />
            </form>
        </div>
    );
};

export default Search;
